import React from "react";


function Creat(props){
   return(
       <div>
    <img id={props.id} className="float-left m-2 rounded" src={props.image} width="200px" height="200px" onClick={()=>{this.imageClick(props.id)}}/>
    </div>
);
}

export default Creat;
